INSERT INTO recipe (recipe_id, name, description, preparation_time, cooking_time, servings, image_content,
                    image_content_type)
VALUES ('burger_saumon_sauce_barbecue_poivrons_grilles',
        'Burgers de saumon, sauce barbecue et poivrons grillés',
        'Cette galette au saumon frais est rehaussée de poivrons grillés, de sauce barbecue, de citron et de chapelure pour lier le tout. Des ingrédients simples en garniture, comme la roquette et les poivrons rouges rôtis, suffisent à sublimer ce burger à l’allure estivale.',
        25, 8, 4,
        '\',
        'image/jpeg');
INSERT INTO recipe (recipe_id, name, description, preparation_time, cooking_time, servings, image_content,
                    image_content_type)
VALUES ('ratatouille',
        'Ratatouille',
        'La ratatouille n’a pas sa pareille pour mettre les légumes à l’honneur et amener du soleil dans nos assiettes. Pour créer la meilleure recette, on a travaillé avec des produits frais et de saison, et on a multiplié les cuissons pour que chaque légume soit à point, avec une texture fondante. Une seule bouchée de ce plat aux parfums relevés nous fait rêver de vacances en Provence!',
        30, 60, 4,
        '\',
        'image/jpeg');
INSERT INTO recipe (recipe_id, name, description, preparation_time, cooking_time, servings, image_content,
                    image_content_type)
VALUES ('saumon_teriyaki_au_four_a_pizza',
        'Saumon teriyaki au four à pizza',
        'Le poisson laqué est toujours une bonne idée de repas auprès des enfants. S’il fait chaud et qu’on souhaite éviter d’ouvrir le four, on se tourne vers le four à pizza pour préparer le souper dans la cour. D’autant plus que cette recette ne nécessite que quelques minutes de cuisson. La sauce teriyaki enrobe parfaitement le poisson qui se défait à la fourchette et on obtient un délicieux repas qui fera partie de vos coups de cœur estivaux.',
        10, 20, 4,
        '\',
        'image/jpeg');
