INSERT INTO recipe (recipe_id, name, description, preparation_time, cooking_time, servings, image_content,
                    image_content_type)
VALUES ('poutine_au_tofu_a_la_plaque_sauce_aux_poivrons',
        'Poutine au tofu à la plaque, sauce aux poivrons',
        'Une poutine comme souper de semaine? Avec des frites de tofu, des brocolis et des pommes de terre grelots cuites au four, on met la culpabilité de côté et on savoure pleinement notre repas. La sauce est faite de bouillon de légumes, de ketchup et de harissa, et le tout est bien sûr garni de fromage en grains.',
        10, 25, 4,
        '\',
        'image/jpeg');

