INSERT INTO step (index, description, recipe_id)
VALUES (1, 'Préchauffer le barbecue à puissance élevée. Huiler la grille.',
        'burger_saumon_sauce_barbecue_poivrons_grilles'),
       (2,
        'Au robot culinaire ou à l’aide d’un couteau, hacher grossièrement le saumon. Déposer dans un bol. Ajouter le reste des ingrédients. Saler, poivrer et bien mélanger.',
        'burger_saumon_sauce_barbecue_poivrons_grilles'),
       (3,
        'Avec les mains, façonner le mélange de poisson en 4 galettes. Déposer sur une grande assiette. Huiler légèrement les galettes.',
        'burger_saumon_sauce_barbecue_poivrons_grilles'),
       (4, 'Griller les galettes 3 minutes de chaque côté ou jusqu’à ce que le poisson soit cuit. Griller les pains.',
        'burger_saumon_sauce_barbecue_poivrons_grilles'),
       (5,
        'Tartiner la base des pains de sauce barbecue. Y déposer les galettes. Garnir des poivrons grillés et de roquette. Tartiner l’intérieur des autres pains de mayonnaise. Refermer les burgers.',
        'burger_saumon_sauce_barbecue_poivrons_grilles'),
       (1, 'Placer la grille au centre du four. Préchauffer le four à 180 °C (350 °F).', 'ratatouille'),
       (2, 'Sur un plan de travail, couper le dessus de la tête d’ail pour exposer les gousses.', 'ratatouille'),
       (3,
        'Dans une cocotte ou une casserole allant au four, déposer la tête d’ail, les tomates et le thym. Arroser de 30 ml (2 c. à soupe) de l’huile. Saler et poivrer. Couvrir et cuire au four 30 minutes ou jusqu’à ce que l’ail soit tendre.',
        'ratatouille'),
       (4,
        'Entre-temps, dans une grande poêle à feu moyen-élevé, dorer la moitié des aubergines à la fois dans 30 ml (2 c. à soupe) de l’huile. Saler et poivrer. Réserver dans un bol.',
        'ratatouille'),
       (5,
        'Dans la même poêle, dorer l’oignon, les courgettes et les poivrons dans le reste de l’huile. Saler et poivrer.',
        'ratatouille'),
       (6,
        'Ajouter les légumes dans la cocotte avec les tomates confites. Bien mélanger. Couvrir et poursuivre la cuisson au four 30 minutes.',
        'ratatouille'),
       (7,
        'Retirer la cocotte du four. Retirer le couvercle. Déposer la tête d’ail sur une assiette. Laisser tiédir 15 minutes. Retirer les branches de thym et les composter. Presser la tête d’ail avec les mains pour en extraire la chair et la mélanger avec les légumes. Composter la pelure d’ail. Rectifier l’assaisonnement. Transvider la ratatouille dans une assiette de service. Garnir de feuilles de basilic.',
        'ratatouille'),
       (8,
        'Accompagner la ratatouille d’un poisson, d’une viande, de pâtes ou simplement servir avec du pain grillé et du fromage.',
        'ratatouille'),
       (1,
        'Déposer la poêle en fonte dans le four à pizza. Préchauffer le four à pizza à intensité élevée (MAX) 20 minutes, la porte fermée.',
        'saumon_teriyaki_au_four_a_pizza'),
       (2,
        'Entre-temps, dans une petite casserole, mélanger la cassonade, la sauce soya, le mirin, le vinaigre, le sambal oelek, l’ail et l’échalote. Porter à ébullition et laisser mijoter à feu moyen 10 minutes ou jusqu’à ce que la sauce soit sirupeuse. Réserver la sauce au chaud.',
        'saumon_teriyaki_au_four_a_pizza'),
       (3, 'Sur une grande assiette, enrober le poisson de l’huile. Saler légèrement et poivrer.',
        'saumon_teriyaki_au_four_a_pizza'),
       (4,
        'Réduire la température du four à intensité moyenne-élevée (3). Déposer les pavés dans la poêle chaude, côté peau vers le bas. Attention aux éclaboussures. Cuire au four 3 minutes, la porte fermée. À l’aide de la poignée amovible, pivoter la poêle d’un demi-tour. Poursuivre la cuisson 3 minutes ou jusqu’au degré de cuisson désiré.',
        'saumon_teriyaki_au_four_a_pizza'),
       (5,
        'Dans des assiettes, répartir les pavés de saumon. Napper de la sauce teriyaki et garnir des graines sésame. Accompagner de riz blanc et d’un légume vert, si désiré.',
        'saumon_teriyaki_au_four_a_pizza'),
       (1, 'Placer la grille dans le tiers inférieur du four. Préchauffer le four à 220 °C (425 °F).',
        'poutine_au_tofu_a_la_plaque_sauce_aux_poivrons'),
       (2,
        'Sur une plaque de cuisson antiadhésive ou tapissée de papier parchemin, enrober le tofu et les pommes de terre de l’huile. Cuire au four 15 minutes.',
        'poutine_au_tofu_a_la_plaque_sauce_aux_poivrons'),
       (3,
        'Retirer la plaque du four. Remuer le tofu et les pommes de terre, puis ajouter le brocoli. Poursuivre la cuisson au four 10 minutes ou jusqu’à ce que le brocoli commence à dorer. Saler et poivrer.',
        'poutine_au_tofu_a_la_plaque_sauce_aux_poivrons'),
       (4,
        'Entre-temps, dans une casserole hors du feu, mélanger au fouet le bouillon, la tartinade de poivrons, le ketchup, la fécule et l’harissa. Porter à ébullition en remuant constamment. Laisser mijoter 2 minutes ou jusqu’à ce que la sauce épaississe légèrement. Saler et poivrer.',
        'poutine_au_tofu_a_la_plaque_sauce_aux_poivrons'),
       (5,
        'Dans des assiettes creuses, répartir les légumes, le tofu et la moitié du fromage en grains. Arroser de la sauce. Garnir du reste du fromage et parsemer du persil. Servir aussitôt.',
        'poutine_au_tofu_a_la_plaque_sauce_aux_poivrons');

